            "id": "LvZ18Qe6lAoP3pZZvBS7S",
            "test": false,
            "description": "Mach dich bereit, München!\n\nHULLIS – Comedy. Dinner. Show ist da und bringt frischen Wind auf die Bühnen der Stadt! Freut euch auf ein herzerfrischendes Showprogramm, entwickelt und zusammengestellt vom erfahrenen Produktionsteam rund um Dinnershow-Profi und künstlerischen Leiter Sven Pawlitschko – in München bekannt als „Daniello“.\n\nEine Live-Show voller Spaß, Lachen, Staunen und Kulinarik, wie ihr sie garantiert noch nie erlebt habt! Erlebt Weltklasse-Varieté mit atemberaubender Akrobatik, energiegeladener Livemusik, einer geballten Ladung Comedy – und ein magisches 4-Gänge-Menü, kreiert von Mario Gamba &amp; Friends.\n\nSeid live dabei, wenn HULLIS, die neue Dinnershow in München mit Musik, Comedy und Weltklasse-Artistik die Nacht zum Leuchten bringt!\n\nUnd hier findet ihr unser HULLIS-Spiegelzelt:\nOrt: Freifläche Messestadt Ost\nAdresse: Sigmund-Riefler-Bogen, 81829 München\nAnfahrt: Über die Autobahnabfahrt Feldkirchen West, Einfahrt Sigmund-Riefler-Bogen oder De-Gasperi-Bogen, Tor 10\nÖPNV: U-Bahn-Station Messestadt Ost, ca. 300\u202fm Fußweg",
