                            "ada": {
                                "adaPhones": "Book a standard ticket via www.ticketmaster.co.uk or call 0800 988 4440 (we expect demand to be high for all tickets at this Venue and tickets to sell out quickly on-line,once purchased, contact the venue on 0207 527 8900 for any further requirements. \n1 Carer goes free and does not require a ticket (Accessible /free companion tickets subject to availability and cannot be guaranteed).\n",
                                "adaCustomCopy": "Islington Assembly Hall is a stunning live music venue on Upper Street in Islington, north London. The grade II listed building’s beautiful art deco interior and recently upgraded PA system and lights combine to offer a unique experience. assemblyhall@islington.gov.uk \nwww.islingtonassemblyhall.co.uk\n\nDirections\nThe best way to get to us is by public transport.\nBy bus: 4, 19, 30, 43 (the \"Islington Town Hall\" stop is right outside)\nBy tube: The Victoria and Overground lines at Highbury and Islington Station (five-minute walk) or Northern line at Angel Station (12-minute walk)\nBy train: National rail services to Highbury and Islington Station and Essex Road Station (10-minute walk)\nBy road: The front entrance to the building is on Upper Street, the A1. \n\nParking\nThere is no customer parking at the venue. \nOn-street parking in the area is limited. The N1 Centre car park is a ten-minute walk away. \n\nAccess information\nCustomers who require assistance and who have bought a ticket for a concert here can request free entry for a personal assistant or carer by contacting the Islington Assembly Hall team directly on 020 7527 8900 or assemblyhall@islington.gov.uk. For more information, visit the venue’s website. \n\n\n\n",
                                "adaHours": "Other information\nFull-capacity shows are for 800, including 600 standing and 200 seated in the balcony. Both areas are unreserved. If you have a ticket for the seated bacony, the view of the stage is great, wherever you sit. Please check details of specific concerts, as some will use the downstairs only and others may have seating throughout, reducing the capacity. Stage times also vary between shows, but doors normally open at 7pm and the venue curfew is 11pm. For the latest information, follow us on Twitter @Islington_AH. It is a 16+ venue, unless otherwise stated for a particular event. It has four bars open at full-capacity gigs, which are all cash only. The nearest cash point is outside the Post Office opposite the venue. Islington Assembly Hall is also available to hire for corporate and private events. For more information and policies, visit the About us section of the venue website.\n"
