                "description": "On Wednesday, 24 September 2025, Patron of Music Jools Holland will host the 13th annual Boisdale Music Awards. Join us for an evening to remember as we celebrate some of the greatest entertainers in the worlds of jazz, blues, soul, reggae and pop, all performing on the Boisdale Yamaha London stage.\n\nExpect a high-spirited awards ceremony featuring spectacular performances from our category award-winning artists. In previous years, we’ve enjoyed incredible performances from global stars like Lisa Stansfield, Gregory Porter, Maxi Priest, Raye, Emeli Sandé, Rebecca Ferguson, The Brand New Heavies, Paul Young and many others!\nThe Boisdale Music Awards 2025 Hosted by Jools Holland All tickets include: Free-flowing drinks reception &amp; a three-course dinner\n\n\n\n6.00pm | Free-flowing Drinks Reception 7.00pm | Three-Course Dinner 9.00pm | Boisdale Music Awards Ceremony\n\nFeaturing over 10 spectacular live performances from our award-winning artists.\nAward Categories 2025 More categories to be announced soon\nArtist of the Year Celebrating an outstanding performer across all genres\nLifetime Achievement Award Recognising a lifetime of significant contribution to the music industry\nGlobal Music &amp; Reggae Artist of the Year Honouring exceptional artistry in reggae and world music\nWatch this space for the full list of award categories and this year’s nominees\n\n\nThe 2024 Boisdale Music Awards Winners\nJazz Artist of the Year | Emma Smith\nOne to Watch | Stone Jets\nBoogie Woogie Artist of the Year | Tom Seals\nBlues Artist of the Year | Connor Selby\nDJ of the Year | Fat Tony\nDJ Lifetime Achievement Award | Trevor Nelson\nReggae Artist of the Year | General Levy\nReggae Legend of the Year | Aswad\nSoul Artist of the Year | Roachford\nFemale Artist of the Year | Sonique\nMale Artist of the Year | Roland Gift\nBand of the Year | Fun Lovin' Criminals\nOutstanding Contribution to British Music | Tony Christie\nLifetime Achievement Award | Jazzie B\nMusic Icon of the Century | Kathy Sledge\nPrevious Years’ Winners Include\nRaye, Gregory Porter, Paul Young, Emeli Sandé, Lemar, Kathy Sledge, UB40, Lisa Stansfield, Maxi Priest, Tony Iommi, Kid Creole &amp; The Coconuts, Shalamar, Snow, Alabama 3, The Christians, Kiki Dee, Ginger Baker, Suzi Quatro, Paul Jones, Imelda May, Fleur East, Rebecca Ferguson, Omar, Janet Kay, Carroll Thompson, Brian McFadden, Natasha Hamilton, Mike D'Abo, Donovan, Clare Teal, Claire Martin, PP Arnold, Cleveland Watkiss, Leee John of Imagination, Osibisa, Pee Wee Ellis, Glen Matlock, Mo Pleasure, Albert Lee, Joe Jackson, Luciano Messenjah, Dennis Bovell, Dennis Greaves of Nine Below Zero, Alexander O'Neal, The Cuban Brothers, Dawn Penn, Carl McIntosh of Loose Ends, Sandi Thom, Hil St Soul, Alexander Armstrong, Chas and Dave, Eddi Reader, Shaun Escoffery, The British Collective, Judi Jackson, Kenney Jones, Tallia Storm, Polly Gibbons, Mud Morganfield, Joseph Malik, Soweto Kinch, Gina Larner and The Brand New Heavies.\n\n\n\n\nMenu\nStarter London Burrata Aubergine caponata, pine nuts, cold-pressed olive oil\nMain Course Roast Suffolk Chicken, Girolles &amp; Tarragon Leek colcannon, black kale, crispy ballotine\nDessert Selection of British Farmhouse Cheese Doyenne Comice pear, chutney, oat cake\n\nDress Code: Smart casual / glamorous\n\nFor tables of under ten guests, please note you may be seated with other guests in a banqueting style.\n\n\n\nVisit our Hine Bar and Heated Garden Terrace located on the 1st floor for pre &amp; post-show drinks! \n\nBOISDALE OF CANARY WHARF\n\nBest Spirits List in the World 2022 at The World Of Fine Wine\nTop Ten restaurant wine lists in London 2022 at The World Of Fine Wine\n\nPerched elegantly above Cabot Square, Boisdale of Canary Wharf offers a multi-dimensional experience across two floors with DJ Nights on weekends at the vibrant first-floor Bar &amp; Garden Terrace, while daily live music sets the perfect ambiance on the second-floor restaurant. Featuring a refined restaurant, four exclusive private dining rooms, the distinguished Hine Bar, extensive whisky and wine selection, a sophisticated Cigar Lounge, and an inviting Heated Garden Terrace, it's a haven for discerning patrons.\n\n\"London's number one jazz venue\" -Tatler\n\"Best Whisky Bar in the World\" -Whisky Magazine\n\"A carnivore's dream\" -Evening Standard\n\"Aged steaks are deemed incredible\" -Square Meal \n\nSubscribe here to Boisdale's weekly newsletter. \n\nFOLLOW US:\nFacebook: https://www.facebook.com/BoisdaleRestaurants\nInstagram:​https://www.instagram.com/boisdale_restaurants \nWebsite: http://www.boisdale.co.uk ",
