                "description": "Table reservations from 6pm | Live Music: 9pm \n“Sensational vocals and incredible energy – Sulene Fleming does Chaka Khan justice!” – Funk &amp; Soul Magazine\n\nJoin us for a spectacular celebration of Chaka Khan’s legendary career in this dazzling two-hour show, Chaka – The Music of Chaka Khan. Sulene Fleming, renowned for her soulful performances with The Brand New Heavies and Incognito, brings her powerful voice and commanding stage presence to honour the Queen of Funk. From the moment the band strikes up those unmistakable grooves, you’ll be transported back to the era of soulful anthems and dance floor magic.\n\n\n\nExpect a night packed with all of Chaka’s biggest hits, from the empowering \"I’m Every Woman\" to the smooth grooves of \"Sweet Thing\", and the infectious energy of \"Like Sugar\". Whether it’s the funk of \"Tell Me Something Good\" or the pulsating rhythm of \"I Feel For You\", this show captures the essence of Chaka’s unmatched talent.\nSulene Fleming’s dynamic vocals, combined with a top-tier live band, create a night of pure musical joy that will have you singing along to every beat.\n\nVisit our Hine Bar and Heated Garden Terrace located on the 1st floor for pre &amp; post-show drinks! \n\nSubscribe here to Boisdale's weekly newsletter. \n\nFOLLOW US:\nFacebook: https://www.facebook.com/BoisdaleRestaurants\nInstagram:​https://www.instagram.com/boisdale_restaurants \nWebsite: http://www.boisdale.co.uk ",
