            {
                "name": "Chaka - The Music of Chaka Khan",
                "type": "event",
                "id": "LvZ18QacucGbKoOZRD7uN",
                "test": false,
                "description": "Doors 6.30pm | Performance 8pm &amp; 7.30pm on Fridays | Event Calendar CLICK HERE\nThe Soul Mama Menu offers a delightful blend of African, Caribbean, and South American cuisine. Soul Mama was listed in the “top restaurants to look forward to in 2024 list” by the Evening Standard. Please take a moment to explore our menu.\n-----------------------------------------------------------------------------\nChaka - The Music of Chaka Khan\n\nAn exhilarating production celebrating one of the world’s most gifted music icons performed by a truly exceptional cast and live band, get ready to dance, sing and groove to iconic hits including I’m Every Woman, Aint Nobody, I Feel for You and many more.\n\n\n\n\nAn exhilarating music show celebrating one of the world’s most gifted music icons and multi-grammy award winner, Chaka Khan.   \n\nHonoring the legacy of a legendary singer and songwriter who has captivated audiences and inspired generations of singers for over five decades with her funk, soul, pop and dance hits, Chaka - The Music of Chaka Khan is the ultimate musical tribute celebrating an icon.\n\nLed by the incomparable Sulene Fleming (The Brand New Heavies, Incognito, The New Master Sounds) and featuring a Stella live band, this 2-hour music show encapsulates the true essence of Chaka Khan \n\n\n\nFeaturing the all-time diva greats and anthemic dance floor hits such as I’m Every Woman, Aint Nobody, I Feel For You, Through The Wire, Like Sugar, and the funk/soul Tell Me Something Good, Sweet Thing, and many more, this show is chock full of irresistible groove and dance floor smash hits - a must see for anyone who loves funk, soul, and dance floor diva classics.  \n\nAs Bridget Jones says; “I prefer Vodka, and Chaka Khan”. \n\nThis show pays homage to a true musical icon and one of the greatest artists of all time whose influence is unmeasurable. \n\nGet ready to dance, sing, and groove to the music that has made Chaka Khan a true icon.\n\n*Please note this is a tribute show and will not feature the original artists",
