                "type": "event",
                "id": "LvZ18QFIk5GTiIYZlfp8Y",
                "test": false,
                "description": "Doors 6pm | Performance 7pm | Event Calendar CLICK HERE\nThe Soul Mama Menu offers a delightful blend of African, Caribbean, and South American cuisine. Soul Mama was listed in the “top restaurants to look forward to in 2024 list” by the Evening Standard. Please take a moment to explore our menu.\n-----------------------------------------------------------------------------\nAn evening of Spoken Word and Music.Vrse &amp; Vibes, is bringing you a night of soulful sounds and captivating spoken word. This special edition features the uplifting melodies of CalledOut Music and the powerful poetic voice of Chantelle Rutendo. Expect a night of heartfelt music and nothing but good energy. This is more than a show – it’s an experience you won’t want to miss.\n\nCalledOut Music\n\n\n\nSamuel Nwachukwu, professionally known as CalledOut Music, is an award-winning singer, songwriter, and multi-instrumentalist whose music inspires hope and faith. Born in Nigeria and raised in the UK, CalledOut Music blends contemporary gospel, soul, and pop to create uplifting tracks that resonate with listeners around the world. Known for hits like “You’re Mine” and “My Prayer,” he has built a reputation for crafting songs with deep lyrical meaning and timeless melodies. His artistry is both refreshing and authentic, making him one of the standout voices in the modern gospel and inspirational music scene.\n\n\n\nChantelle Rutendo\n\n\n\nChantelle Rutendo is a gifted gospel artist with a voice that radiates passion and faith. Known for her heartfelt performances and rich vocal tone, Chantelle combines contemporary gospel with soulful undertones to create music that uplifts and inspires. Her artistry reflects a deep commitment to spreading hope and faith through every lyric and melody, making her an emerging force in the gospel music scene. \n\n\n",
