            {
                "name": "The Music of Harry Potter by Mystery Ensemble",
                "type": "event",
                "id": "LvZ18QawV5QUGB8ZRdQ4l",
                "test": false,
                "description": "✨ Immerse yourself in the world of magical music from the cult fantasy based on the novels of the same name by J.K. Rowling - the most enchanting event of winter for the whole family, an experience not to be missed! The evening programme includes music from unforgettable fantasy films of Harry Potter performed by the extraordinary Mystery Ensemble.\n\nThe film's soundtracks were masterfully composed by John Williams. The composer wrote the music at his mansions in Los Angeles and Tanglewood and then recorded at Abbey Road and Air Lyndhurst studios in London in September 2001. The film features many characteristic leitmotifs, most of which were repeated in the second part of the Harry Potter and the Chamber of Secrets franchise. The main composition, \"Hedwig's Theme\", is present in all films in a modified form. The soundtrack was released on October 30, 2001, on CD media.\n\nOn December 14, 2001, the soundtrack was certified gold in Canada (50,000 units) and in January 2002 in Japan (100,000 units). In 2002, John Williams was nominated for an Academy Award for Best Music for a Film but lost to Howard Shore, who wrote the compositions for another fantasy film, The Lord of the Rings: The Fellowship of the Ring, another fantasy film, “The Lord of the Rings: The Fellowship of the Ring”, music from which can also be heard at our concerts.\n\nThe album became a success, peaking at number 48 on the Billboard 200 and number two on the Top Soundtracks Chart. In the official UK charts, the album was at number 19.\n\nDuration: 60 minutes (doors open 30 minutes prior; late entry is not permitted).\nDoors open at least 30 minutes before the concert.\nOut of respect for guests and performers, late entry may not be permitted. We cannot guarantee your original seats after the concert begins.\nAge restriction: 6+\n\nAbout Mystery Ensemble\nMystery Ensemble is a group of professional musicians performing unique programs on non-standard venues around the UK.\n\nExperience outstanding works from different eras, experimental music, tributes, and world soundtracks of films and series, as well as absolutely unique programs and immersive shows. All music presented in author’s arrangements. With the possibility of independent choice of the program, unexpected locations, and flexibility of the format, our team of professional musicians is inspired to bring their favorite music to life.\n\nFounded in 2021, our studio of contemporary music has grown rapidly, with over 40 shows in the UK in its first year of performing. Our founder, Almin Alexander, has devoted more than 12 years of his life to the music industry and the development of cultural initiatives around the world, working with many outstanding musicians and musical groups.\n\nThe ensemble’s repertoire contains an incredible amount of music. Just look at some of the programs so dearly loved by our viewers: these are tribute concerts of such great composers as Ludovico Einaudi, Hans Zimmer, John Williams, Ólafur Arnalds, Joe Hisaishi, or the minimalists’ John Cage and David Lang, along with At the same time, the ensemble performs popular soundtracks from sensational TV shows and movies: Wednesday, The Young Pope, Harry Potter, a variety of Disney and Pixar films, Pirates of the Caribbean, The Lord of the Rings and The Hobbit saga, Spencer, Star Wars and others. There is also the unique music of Enigma, Enya, combined with neoclassical music, or world rock hits, and tributes to the legendary Michael Jackson, Queen and the Beatles. For lovers of the classics, the ensemble collection contains music by W.A. Mozart, J.S. Bach, L.V. Beethoven, R. Wagner, I. Strauss, P.I. Tchaikovsky, S.V. Rachmaninov, and all key composers — classics. And much more. Every month the studio releases new programs and updates the existing repertoire.\nFor some projects, the team gathers as part of a chamber or small symphony orchestra.\n\nProgramme\n\nHedwig’s Theme \nAnother story \nProfessor Umbridge\nEnd Titles \nHogwarts March\nHarry’s wondrous Word\nDumbledore’s Army\nFarewell Aragog\nGilderoy Lockhart\nHogwarts Forever\nHogwarts Hymn\nLily’s Theme\nHarry and Hermione\nChristmas\nPotter Waltz \nSnape of Malfoy Manor \nHarry in Winter \nDouble Trouble\nFlight of the Order of Phoenix\n\n*The programme may be subject to changes",
