            {
                "name": "The Music of The Lord of The Rings. Tribute to Howard Shore",
                "type": "event",
                "id": "LvZ18QkBf5N8HaYZ0FC-d",
                "test": false,
                "description": " Join us at the magnificent Southwark Cathedral for Our Precious Concert – one of our most beloved and best-selling programmes, now coming to London in its most magical form yet.\n\nExperience the majestic and timeless music of the legendary Lord of the Rings films in a breathtaking concert that will transport you straight into the heart of Tolkien’s universe. Howard Shore’s iconic soundtrack has captivated millions across the world – and now, we bring it to life in a spellbinding performance that includes vocal music inspired by Elvish songs, ancient folklore, and the poetic spirit of Middle-earth.\n\nPerformed by the modern orchestra Mystery Ensemble, this immersive evening will guide you through a sonic journey where elves sing, hobbits dance, and the shadows of Mordor loom in the distance. Alongside the orchestra, live vocalists will embody the voices of Tolkien’s world — from ethereal Elvish laments to the haunting chants of ancient realms, bringing a deeply emotional and otherworldly dimension to the music of The Lord of the Rings.\n\nAbout the venue\nSituated in the heart of historic London, just steps from Borough Market and London Bridge, Southwark Cathedral is far more than a place of worship — it is one of the city’s most atmospheric and majestic concert venues. As the oldest Gothic church in London, with origins dating back to the 12th century, every arch and stained glass window carries the weight and wonder of centuries past.\n\nAcoustically, Southwark Cathedral is widely regarded as one of the finest venues in the capital for choral, sacred, and chamber music. Its soaring vaulted ceilings and stone architecture create a natural resonance of remarkable clarity and depth, allowing every note to linger and unfold with grace. This is a space where music breathes — timeless, powerful, and profoundly moving.\n\nSouthwark Cathedral is not merely a venue — it is a symbol. A space where music, history, and sacred beauty converge in one of the world’s most culturally vibrant cities. Hosting a concert here is more than a choice of location; it is a tribute to London’s grandeur and its deep-rooted tradition of artistic excellence.\n\nThis concert is part of a series of immersive musical experiences created by Red Events &amp; Distribution Ltd., known for their exceptional cultural events in historic mansions, on scenic rooftops, in botanical greenhouses, and other atmospheric venues across the UK, Europe, Georgia, Armenia, Azerbaijan and beyond. Their repertoire includes candlelite concerts and fully immersive performances with video art and spatial sound design.\n\nDuration: 60 minutes\nDoors open at least 30 minutes before the concert.\nOut of respect for guests and performers, late entry may not be permitted. We cannot guarantee your original seats after the concert begins.\nAge restriction: 6+ \n\nAbout Mystery Ensemble\nMystery Ensemble is a group of professional musicians performing unique programs on non-standard venues around the UK.\n\nExperience outstanding works from different eras, experimental music, tributes, and world soundtracks of films and series, as well as absolutely unique programs and immersive shows. All music presented in author’s arrangements. With the possibility of independent choice of the program, unexpected locations, and flexibility of the format, our team of professional musicians is inspired to bring their favorite music to life.\n\nFounded in 2021, our studio of contemporary music has grown rapidly, with over 40 shows in the UK in its first year of performing. Our founder, Almin Alexander, has devoted more than 12 years of his life to the music industry and the development of cultural initiatives around the world, working with many outstanding musicians and musical groups.The ensemble’s repertoire contains an incredible amount of music. Just look at some of the programs so dearly loved by our viewers: these are tribute concerts of such great composers as Ludovico Einaudi, Hans Zimmer, John Williams, Ólafur Arnalds, Joe Hisaishi, or the minimalists’ John Cage and David Lang, along with At the same time, the ensemble performs popular soundtracks from sensational TV shows and movies: Wednesday, The Young Pope, Harry Potter, a variety of Disney and Pixar films, Pirates of the Caribbean, The Lord of the Rings and The Hobbit saga, Spencer, Star Wars and others. There is also the unique music of Enigma, Enya, combined with neoclassical music, or world rock hits, and tributes to the legendary Michael Jackson, Queen and the Beatles. For lovers of the classics, the ensemble collection contains music by W.A. Mozart, J.S. Bach, L.V. Beethoven, R. Wagner, I. Strauss, P.I. Tchaikovsky, S.V. Rachmaninov, and all key composers — classics. And much more. Every month the studio releases new programs and updates the existing repertoire.\nFor some projects, the team gathers as part of a chamber or small symphony orchestra.\n\nJoin us and experience the creative energy and passion that drives our team to bring music to life in unforgettable ways!\n\nProgramme\n\nThe Fellowship of the Ring\nBag End\nThe Shire\nFarewell, dear Bilbo\nSaruman, The White\nGollum\nThe Mirror of Galadriel\nThe Houses of Healing\nThe Grace of Undomiel\nMay It Be\nThe Road Goes Ever On\n\n*The programme may be subject to changes",
