                "type": "event",
                "id": "LvZ18Q5v10Os_E8ZRPT1E",
                "test": false,
                "description": "Doors 6.30pm | Performance 8.30pm | Event Calendar CLICK HERE\nThe Soul Mama Menu offers a delightful blend of African, Caribbean, and South American cuisine. Soul Mama was listed in the “top restaurants to look forward to in 2024 list” by the Evening Standard. Please take a moment to explore our menu.\n-------------------------------------------------------------------------------------------------------------------------------------\nLovers Rock Romantic Reggae with Winston Reedy\n\nWinston Reedy is a Jamaican reggae singer. Previously vocalist for the Cimarons from 1970, he is best known as a lovers rock vocalist with hits such as \"Paradise in Your Eyes\", \"Moi Emma Oh\" and, in particular, \"Dim The Lights\" (1983), which saw Reid crowned as Britain's best reggae singer three years in a row after he went solo.\n\n\nHailing from Jamaica, Winston Reedy is renowned as one of the most successful and popular UK-based Reggae singers. He’s a master of both roots and lovers genres.  In the 1970s, he was lead vocalist with one of the UK’s top reggae bands, The Cimarons. The band made a trip to Jamaica in 1975 to record an album called On The Rock, and released a version of Bob Marley’s Talking Blues which went to number 1 in Jamaica. Playing with The Cimarons created the opportunity for Winston to work with some of the industry’s top names, including Jimmy Cliff, Dennis Brown, Dennis Alcapone, The Pioneers and Paul McCartney, to name a few.    Winston Reedy has played at venues such as Royal Festival Hall, Royal Albert Hall, and Wembley Stadium, alongside acts such as Bob Dylan, Santana and UB40. He’s a regular performer on the hit annual show Giants Of Lovers Rock at the O2 Greenwich.\n\n\n\n\n\n\n\n\n\n\n",
